import React from 'react';

const ContactPage = () => (
  <div style={{fontSize: '20px', textAlign: 'center'}}>
    <div>Hi, this is just a portfolio. My name is Nguyen Quoc Khanh and you can contact me at:</div>
    <a href="https://github.com/khanhcoluy">Email: quockhanhnguyen.it@gmail.com</a>
    <a href="https://github.com/khanhcoluy">Github: gib</a>
  </div>
);

export default ContactPage;
